script: |
  super -f text -I q12399.spq | sort > q12399.out

inputs:
  - name: q12399.spq
    data: |
      SELECT + ( + + col0 ) AS col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT 10 NOT BETWEEN + + 36 AND - - col1 / + - col0 + + + col0 + - - col1 + - - 48;
  - name: tab1

outputs:
  - name: q12399.out
    data: |
